import { Injectable, inject } from '@angular/core';
import { HttpClient } from '@angular/common/http';
import { Observable, tap } from 'rxjs';

import { LoginRequest, LoginResponse, RegisterRequest, RegisterResponse } from './auth.model';
import { TokenService } from '@shared/services/token/token.service';
import { UserLoggedService } from '@shared/services/user-logged/user-logged.service';
import { environment } from 'environments/environment';

@Injectable({
  providedIn: 'root'
})
export class AuthService {
  #userService = inject(UserLoggedService);
  #tokenService = inject(TokenService);
  #http = inject(HttpClient);
  #baseUrl = environment.url;

  login({ email, password }: LoginRequest): Observable<LoginResponse> {
    return this.#http.post<LoginResponse>(`${this.#baseUrl}/auth/login`, { email, password })
      .pipe(
        tap(({ access_token }) => this.#tokenService.token = access_token),
        tap(response => {
          this.#userService.seUserLogged(response);
        })
      )
  }

  register(payload: RegisterRequest): Observable<RegisterResponse> {
    let url = `${this.#baseUrl}/auth/register/`;
    url += payload.role.toLocaleLowerCase();

    return this.#http.post<RegisterResponse>(url, payload)
      .pipe(
        tap(({ access_token }) => this.#tokenService.token = access_token),
        tap(response => {
          this.#userService.seUserLogged(response as any);
        })
      )
  }

  logout() {
    this.#tokenService.clearToken();
  }
}

import { HttpClient } from '@angular/common/http';
import { Injectable, inject } from '@angular/core';
import { Observable, tap } from 'rxjs';

import { College, CollegeRequest, CollegeResponse, ResponseCollegelist } from './collage.model';
import { environment } from 'environments/environment';
import { Utils } from '../utils/utils.service';
import { UserLoggedService } from '../user-logged/user-logged.service';

@Injectable({
  providedIn: 'root'
})
export class CollegeService {
  #userService = inject(UserLoggedService);
  #http = inject(HttpClient);
  #baseUrl = environment.url;

  getCollages(collegeId: string | number): Observable<College> {
    return new Observable((subscribe) => {
      const id = `${collegeId}`;
      const inMemory = this.getCollagesInMemory(id);

      if (inMemory) {
        subscribe.next(inMemory)
        subscribe.complete();
        return;
      }

      this.searchCollagesByCollegeId(id).subscribe({
        next: (response) => {
          subscribe.next(response);
          subscribe.complete();
        },
        error: (error) => {
          subscribe.error(error);
          subscribe.complete();
        }
      })
    })
  }

  getCollagesInMemory(collegeId: string): College {
    const user = this.#userService.user();
    const college = user.colleges.filter((college) => `${college.id}` === collegeId);
    return college[0] ?? null;
  }

  searchCollagesByCollegeId(collegeId: string): Observable<ResponseCollegelist> {
    return this.#http.get<ResponseCollegelist>(`${this.#baseUrl}/college/${collegeId}`).pipe(
      tap(res => this.updateCollegeInMemory(res))
    );
  }

  searchCollagesByUser(): Observable<ResponseCollegelist[]> {
    return this.#http.get<ResponseCollegelist[]>(`${this.#baseUrl}/college`).pipe(
      // tap(res => this.updateCollegeInMemory(res))
    );
  }

  createCollege(payload: CollegeRequest): Observable<CollegeResponse> {
    const formatedPayload = Utils.convertToFormData(payload);
    return this.#http.post<CollegeResponse>(`${this.#baseUrl}/college`, formatedPayload).pipe(
      // tap(res => this.updateCollegeInMemory(res))
    );
  }


  updateCollegeInMemory(college: College): void {
    const user = this.#userService.user();
    let currentCollege = user.colleges.filter(({ id }) => id === college.id)[0];
    currentCollege ? currentCollege = college : user.colleges.push(college);
  }
}

import { HttpClient } from '@angular/common/http';
import { Injectable, inject } from '@angular/core';
import { Observable, switchMap, tap } from 'rxjs';

import { ICourse, IRequestCourseCreate, IResponseCourseCreate, IResponseCourseGetById } from './course.model';
import { UserLoggedService } from '../user-logged/user-logged.service';
import { environment } from 'environments/environment';
import { Utils } from '../utils/utils.service';

@Injectable({
  providedIn: 'root'
})
export class CourseService {
  #userService = inject(UserLoggedService);
  #http = inject(HttpClient);
  #baseUrl = environment.url;

  create(payload: IRequestCourseCreate): Observable<IResponseCourseCreate> {
    const formatedPayload = Utils.convertToFormData(payload);
    return this.#http.post<IResponseCourseCreate>(`${this.#baseUrl}/course`, formatedPayload).pipe(
      tap((res) => this.updateCourseInMemory(res))
    )
  }

  getCourse(collegeId: string | number): Observable<ICourse> {
    return new Observable((subscribe) => {
      const id = `${collegeId}`;
      const inMemory = this.getCourseInMemory(id);

      if (inMemory) {
        subscribe.next(inMemory)
        subscribe.complete();
        return;
      }

      this.searchCourseById(id).subscribe({
        next: (response) => {
          subscribe.next(response);
          subscribe.complete();
        },
        error: (error) => {
          subscribe.error(error);
          subscribe.complete();
        }
      })
    });
  }

  getCourseInMemory(coursesId: string): ICourse {
    const courses = this.getCoursesInMemory();
    const course = courses.filter(course => course.id === parseInt(coursesId));
    return course[0] ?? null;
  }

  updateCourseInMemory(course: ICourse): void {
    const user = this.#userService.user();
    const college = user.colleges.filter((college) => college.id === course.collegeId)[0];

    let currentCourse = college.Course.filter((college) => college.id === course.id)[0];
    currentCourse ? currentCourse = course : user.colleges.push(college);
  }

  getCoursesInMemory(): ICourse[] {
    const user = this.#userService.user();
    return user.colleges.reduce<ICourse[]>((acumulator, current) => {
      if (current.Course.length) acumulator.push(...current.Course);
      return acumulator
    }, []);
  }

  getContent(coursesId: string | number): Observable<any> {
    return this.#http.get<any>(`${this.#baseUrl}/course/${coursesId}/content`);
  }

  searchCourseById(coursesId: string): Observable<IResponseCourseGetById> {
    return this.#http.get<IResponseCourseGetById>(`${this.#baseUrl}/course/${coursesId}`);
  }
}

