  ]
})
export class InputColorComponent implements OnInit, ControlValueAccessor {
  readonly disabled = input(false);
  readonly error = input(false);
  readonly label = input('');
  readonly id = input('');
  val = '';

  ngOnInit(): void { }

  onChange: any = () => { };

  onTouched: any = () => { };

  get value() {
    return this.val;
  }

  set value(val) {
    if (val !== undefined && val !== null) {
      this.val = val;
      this.onChange(val);
      this.onTouched(val);
    }
  }

  onBlur() { }

  /**
   * @description Essa funo foi criada para atender ha uma
   * necessidade do cypress pois no cypress quando disparamos
   * uma funo com trigger no esta atualizando o ngModel do angular.
   *
   * Fica como TODO como fazer isso de uma forma menos gambiarra
   */
  getColorToValProperty(color: any) {
    this.value = color;
  }

  writeValue(value: any) {
