  loading = signal(true);

  public ngOnInit(): void {
    this.#router.paramMap.subscribe({
      next: params => {
        const lessonId = params.get('id');
        if (!lessonId) return this.loading.set(false);

        this.#lesson.get(lessonId).subscribe({
